const filterCars = (selectedCategory, selectedSubCategory, cars, setFilteredCars) => {
    const filteredCars = cars.filter(
      (car) => car.category === selectedCategory && car.seats === selectedSubCategory
    );
    setFilteredCars(filteredCars);
  };

  export default filterCars;
